		function readJSON(path, callback) {
			var xhr = new XMLHttpRequest();
			xhr.open('GET', path, true);
			xhr.responseType = 'blob';
			xhr.onload = function(e) { 
			  if (this.status == 200) {
				  var file = new File([this.response], 'temp');
				  var fileReader = new FileReader();
				  fileReader.addEventListener('load', function(){
					   callback(fileReader.result)
				  });
				  fileReader.readAsText(file);
			  } 
			}
			xhr.send();
		}
		
		function drawPoly(data) {
			var ctx = document.getElementById('gameCanvas').getContext('2d');
			
			ctx.fillStyle = "#FF000088";
			ctx.lineWidth = 1;
			ctx.strokeStyle = "#FF0000";
			 
			var poly = data.poly
			//console.log( poly.length)
			for (var t = 0; t < poly.length; ++t) {
				ctx.beginPath();		

				var geom = poly[t].geom;
				
				ctx.moveTo(geom[0].x, geom[0].y);
				
				for (var i = 1; i < geom.length; i++) {
					ctx.lineTo(geom[i].x, geom[i].y);
					//console.log(geom[i].x, geom[i].y);
				}
				
				ctx.closePath();
				ctx.fill();
			}
		}		
		
		function drawPoint(point) {
			var ctx = document.getElementById('gameCanvas').getContext('2d');
			
			ctx.fillStyle = "#FF0000";	
			
			var geom = point.geom;
			
			for (var i = 0; i < geom.length; i++) {
				//ctx.lineTo(geom[i].x, geom[i].y);
				ctx.fillRect(geom[i].x, geom[i].y, 5, 5);
			}
			//
			console.log(geom[0]);
			
			ctx.fill();
		}
		
		function drawSpawn(name) {
			console.log(name)
			readJSON('locs/'+ name + '.json', function(data){
				
				var ctx = document.getElementById('gameCanvas').getContext('2d');
				ctx.clearRect(0, 0, document.getElementById('gameCanvas').width, document.getElementById('gameCanvas').height);
				
				var object = JSON.parse(data)			
				//console.log(object);
				if (object.type === "poly") {
					// Location is a polygon type
					drawPoly(object.data);
				} else {
					// Location is a point
					drawPoint(object.data);
				}				
			})
		};
	
		var npc = getUrlVars()["npc"];
		drawSpawn(npc)
